import React from 'react';

const AboutUs = () => {
  return (
    <div className="min-h-screen bg-gradient-to-b from-white via-purple-50 to-white text-gray-800 py-12 px-6 max-w-6xl mx-auto">
      
      {/* Page Header */}
      <h1 className="text-5xl font-bold text-center text-pink-600 mb-10">
        About Us
      </h1>

      {/* Mission */}
      <section className="mb-12">
        <h2 className="text-3xl font-semibold text-purple-700 mb-3">✈️ Our Mission</h2>
        <p className="text-lg leading-relaxed">
          At <span className="font-semibold">Your Airline Company</span>, we’re redefining modern travel by blending affordability, comfort, and next-gen service. For us, flying isn’t just a journey — it’s a joyful experience waiting to unfold.
        </p>
      </section>

      {/* Vision */}
      <section className="mb-12">
        <h2 className="text-3xl font-semibold text-purple-700 mb-3">🌍 Our Vision</h2>
        <p className="text-lg leading-relaxed">
          We envision a connected world where flying is smart, seamless, and accessible to everyone — whether you're exploring new cultures or connecting with loved ones.
        </p>
      </section>

      {/* Core Values */}
      <section className="mb-12">
        <h2 className="text-3xl font-semibold text-purple-700 mb-3">💜 Our Core Values</h2>
        <ul className="list-disc pl-6 text-lg space-y-2">
          <li><strong>People First:</strong> Travel is personal, and so is our care for you.</li>
          <li><strong>Innovation-Driven:</strong> Tech is our co-pilot, always improving your experience.</li>
          <li><strong>Clarity Always:</strong> No hidden fees, no small print. Just honest flights.</li>
          <li><strong>Planet-Conscious:</strong> Greener skies through responsible choices.</li>
        </ul>
      </section>

      {/* What Makes Us Unique */}
      <section className="mb-16">
        <h2 className="text-3xl font-semibold text-purple-700 mb-4">🚀 Why Fly With Us?</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6 text-lg">
          {[
            {
              title: 'All-in-One Travel Hub',
              desc: 'Book, check-in, explore deals, and manage your journey — all in one place.'
            },
            {
              title: '24/7 Human Support',
              desc: 'Always reachable. Always real. Your needs don’t clock out — neither do we.'
            },
            {
              title: 'Flexible Everything',
              desc: 'Change of plans? We make rescheduling or cancellations stress-free.'
            },
            {
              title: 'Exclusive Travel Perks',
              desc: 'Unlock early boarding, free upgrades, and members-only fares.'
            }
          ].map((item, i) => (
            <div key={i} className="bg-white border-l-4 border-pink-500 p-4 shadow-sm rounded">
              <h4 className="font-semibold">{item.title}</h4>
              <p>{item.desc}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Meet the Team */}
      <section className="mb-16">
        <h2 className="text-3xl font-semibold text-purple-700 mb-3">🤝 Meet the Crew</h2>
        <p className="text-lg mb-3">
          Behind every smooth takeoff is a passionate team from the worlds of aviation, tech, and hospitality. We’re here to ensure every seat booked leads to a memorable journey.
        </p>
        <p className="text-lg">
          We’re more than an airline — we’re your travel companion.
        </p>
      </section>

      {/* CTA */}
      <section className="text-center mb-20">
        <h2 className="text-3xl font-bold text-pink-600 mb-3">Start Your Journey with Us</h2>
        <p className="text-lg mb-5">From quick getaways to bucket-list adventures — we’re here to make it unforgettable.</p>
        <a
          href="/services"
          className="inline-block bg-pink-600 hover:bg-pink-700 text-white text-lg font-semibold py-3 px-8 rounded-lg transition duration-300 shadow-md"
        >
          Explore Our Services
        </a>
      </section>

      {/* Footer */}
      <footer className="text-center text-sm text-gray-500 mt-10">
        © {new Date().getFullYear()} Your Airline Company. All rights reserved.
      </footer>
    </div>
  );
};

export default AboutUs;
